    /**
     * 実行イベント
     * @method
     * @name FrameWork.GameMain#onRun
     */
    GameMain.prototype.onRun = function () {
        //表示位置の設定:マップの移動
        var centerX = this.screenWidth * 0.5;
        var centerY = this.screenHeight * 0.5;
        if (this.isTouch === true) {
            //表示位置の設定:マップの移動
            var addX = 0;
            var addY = 0;
            //中心位置との距離を求める
            var tempX = this.touchX - centerX;
            var tempY = this.touchY - centerY;
            var dir = this.player.Dir;
            if (Math.abs(tempX) < Math.abs(tempY)) {
                //Yの距離のほうが値が大きい
                if (tempY < 0) {
                    addY = -1;
                    dir = Rf.ETS.FrameWork.Direction.Up;
                }
                else {
                    addY = 1;
                    dir = Rf.ETS.FrameWork.Direction.Down;
                }
            }
            else {
                //Xの距離のほうが値が大きい
                if (tempX < 0) {
                    addX = -1;
                    dir = Rf.ETS.FrameWork.Direction.Left;
                }
                else {
                    addX = 1;
                    dir = Rf.ETS.FrameWork.Direction.Right;
                }
            }
            if (this.player.Dir != dir) {
                this.player.Dir = dir;
            }
            var hitTestX = this.player.x + addX * 16;
            var hitTestY = this.player.y + addY * 16 + 16;
            if (this.backgroundMap.hitTest(hitTestX, hitTestY) === false
                && this.backgroundMap.hitTest(hitTestX + 16, hitTestY) === false) {
                this.player.x += addX * 16;
                this.player.y += addY * 16;
                this.player.Run();
            }
        }
        this.group.x = -this.player.x + centerX;
        if (this.group.x > 0) {
            this.group.x = 0;
        }
        if (this.group.x < -16 * this.mapWidth + this.screenWidth) {
            this.group.x = -16 * this.mapWidth + this.screenWidth;
        }
        this.group.y = -this.player.y + centerY;
        if (this.group.y > 0) {
            this.group.y = 0;
        }
        if (this.group.y <= -16 * this.mapHeight + this.screenHeight) {
            this.group.y = -16 * this.mapHeight + this.screenHeight;
        }
    };
    return GameMain;
